import React from 'react';
import { Button, Typography, Box } from '@mui/material';

const FormConfirmAddPlant = ({plantInfo}) => {
    return (
        <Box>
            <Box>
              <Typography>{plantInfo.name}</Typography>
            </Box>
            <Box>
                <Button>Confirm</Button>
                <Button>Edit</Button>
            </Box>
        </Box>
    )
}

export default FormConfirmAddPlant;
